import React from "react";
import GridViewIcon from "@mui/icons-material/GridView";

const TopBarContainer = ({ contentFormToggle, setContentFormToggle }) => {
  return (
    <div className="topbar-container">
      <div className="topbar-content">
        {contentFormToggle ? (
          <GridViewIcon onClick={() => setContentFormToggle(false)} />
        ) : (
          <GridViewIcon onClick={() => setContentFormToggle(true)} />
        )}
      </div>
    </div>
  );
};

export default TopBarContainer;
